// Define relations for an LLM agent's knowledge graph

const IsA = createRelation()
const HasProperty = createRelation()
const RelatedTo = createRelation()
const PartOf = createRelation()
const LocatedIn = createRelation()
const CanInteractWith = createRelation()

// Example usage for an LLM agent with spatial awareness and agent interactions

// Concept: "LLM Agent"
const addLLMAgentConcept = (world, agentEntity, name, location) => {
  addComponent(world, agentEntity, IsA("AI"))
  addComponent(world, agentEntity, HasProperty("Intelligent"))
  addComponent(world, agentEntity, HasProperty("Language-capable"))
  addComponent(world, agentEntity, LocatedIn(location))
  addComponent(world, agentEntity, RelatedTo("Virtual Assistant"))
  addComponent(world, agentEntity, CanInteractWith("Human"))
  addComponent(world, agentEntity, CanInteractWith("Other LLM Agents"))
}

// Concept: "Virtual Space"
const addVirtualSpaceConcept = (world, spaceEntity, name) => {
  addComponent(world, spaceEntity, IsA("Environment"))
  addComponent(world, spaceEntity, HasProperty("Digital"))
  addComponent(world, spaceEntity, RelatedTo("Cyberspace"))
}

// Create LLM agents and virtual spaces
const agent1 = addEntity(world)
const agent2 = addEntity(world)
const virtualOffice = addEntity(world)

addLLMAgentConcept(world, agent1, "Agent1", "VirtualOffice")
addLLMAgentConcept(world, agent2, "Agent2", "VirtualOffice")
addVirtualSpaceConcept(world, virtualOffice, "VirtualOffice")

// Query example: Find all intelligent entities in the virtual office
const intelligentEntitiesInOffice = query(world, [
  IsA("AI"),
  HasProperty("Intelligent"),
  LocatedIn("VirtualOffice")
])

// Query example: Find all entities that can interact with humans
const humanInteractiveEntities = query(world, [
  CanInteractWith("Human")
])

// Query example: Find all digital environments
const digitalEnvironments = query(world, [
  IsA("Environment"),
  HasProperty("Digital")
])
